import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useCart } from '../context/CartContext';
import '../styles/SwiggyStyle.css';

const popularItems = [
  { id: 1, name: 'Pizza', price: 250, image: process.env.PUBLIC_URL + '/images/pizza.jpeg' },
  { id: 2, name: 'Burger', price: 150, image: process.env.PUBLIC_URL + '/images/burger.jpeg' },
  { id: 3, name: 'Noodles', price: 180, image: process.env.PUBLIC_URL + '/images/noodles.jpeg' },
  { id: 4, name: 'Cold Drinks', price: 50, image: process.env.PUBLIC_URL + '/images/cold-drinks.jpeg' },
  { id: 5, name: 'Ice Cream', price: 120, image: process.env.PUBLIC_URL + '/images/icecream.jpeg' },
  { id: 6, name: 'Sweets', price: 200, image: process.env.PUBLIC_URL + '/images/sweets.jpeg' },
  { id: 7, name: 'Paneer Butter Masala', price: 220, image: process.env.PUBLIC_URL + '/images/butterpannermasala.jpeg' },
  { id: 8, name: 'Chicken Biryani', price: 210, image: process.env.PUBLIC_URL + '/images/ChikenBiryani.jpeg' },
  { id: 9, name: 'Veg Pulao', price: 180, image: process.env.PUBLIC_URL + '/images/VegPulao.jpeg' },
  { id: 10, name: 'Butter Naan', price: 90, image: process.env.PUBLIC_URL + '/images/butternaan.jpeg' },
  { id: 11, name: 'Masala Dosa', price: 100, image: process.env.PUBLIC_URL + '/images/masaladosa.jpeg' },
  { id: 12, name: 'Chole Bhature', price: 130, image: process.env.PUBLIC_URL + '/images/Chole Bhature.jpeg' },
  { id: 13, name: 'Tandoori Chicken', price: 250, image: process.env.PUBLIC_URL + '/images/Tandoori Chicken.jpeg' },
  { id: 14, name: 'Dal Makhani', price: 150, image: process.env.PUBLIC_URL + '/images/Dal Makhani.jpeg' },
  { id: 15, name: 'Samosa', price: 50, image: process.env.PUBLIC_URL + '/images/Samosa.jpeg' },
  { id: 16, name: 'Pav Bhaji', price: 120, image: process.env.PUBLIC_URL + '/images/Pav Bhaji.jpeg' },
  { id: 17, name: 'Rajma Chawal', price: 140, image: process.env.PUBLIC_URL + '/images/Rajma Chawal.jpeg' },
  { id: 18, name: 'Aloo Paratha', price: 110, image: process.env.PUBLIC_URL + '/images/Aloo Paratha.jpeg' },
  { id: 19, name: 'Fish Curry', price: 230, image: process.env.PUBLIC_URL + '/images/Fish Curry.jpeg' },
  { id: 20, name: 'Mutton Rogan Josh', price: 270, image: process.env.PUBLIC_URL + '/images/Mutton Rogan Josh.jpeg' },
  { id: 21, name: 'Idli Sambhar', price: 90, image: process.env.PUBLIC_URL + '/images/Idli Sambhar.jpeg' },
  { id: 22, name: 'Pani Puri', price: 80, image: process.env.PUBLIC_URL + '/images/Pani Puri.jpeg' },
  { id: 23, name: 'Vada Pav', price: 70, image: process.env.PUBLIC_URL + '/images/Vada Pav.jpeg' },
  { id: 24, name: 'Gulab Jamun', price: 60, image: process.env.PUBLIC_URL + '/images/Gulab Jamun.jpeg' },
  { id: 25, name: 'Rasgulla', price: 65, image: process.env.PUBLIC_URL + '/images/Rasgulla.jpeg' },
];

const PopularFood = () => {
  const navigate = useNavigate();
  const { addToCart } = useCart();

  const handleAddToCart = (item) => {
    addToCart(item);
    alert(`${item.name} added to cart`);
  };

  return (
    <div
      className="main-content"
      style={{
        maxWidth: '100%',
        margin: '0 auto',
        backgroundColor: '#fff8f8',
        padding: '40px 60px',
        borderRadius: '12px',
        minHeight: '100vh',
        boxSizing: 'border-box',
      }}
    >
      <h1 style={{ color: '#d32f2f', fontWeight: '700', marginBottom: '30px', textAlign: 'center' }}>Popular Food</h1>
      <div
        className="food-gallery"
        style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fill, minmax(220px, 1fr))',
          gap: '2rem',
          justifyItems: 'center',
        }}
      >
        {popularItems.map((item) => (
          <div
            key={item.id}
            className="food-item"
            style={{
              backgroundColor: '#f5f5f5',
              borderRadius: '8px',
              padding: '1rem',
              textAlign: 'center',
              boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
              transition: 'transform 0.2s ease, box-shadow 0.2s ease',
              width: '220px',
            }}
          >
            <img
              src={item.image}
              alt={item.name}
              style={{ width: '100%', height: '180px', objectFit: 'cover', borderRadius: '6px', marginBottom: '0.5rem' }}
              onError={(e) => {
                e.target.style.display = 'none';
              }}
            />
            <div className="food-name" style={{ fontWeight: '600', marginBottom: '0.5rem', color: '#333' }}>
              {item.name}
            </div>
            <div className="food-price" style={{ fontWeight: '600', color: '#d32f2f', marginBottom: '0.5rem' }}>
              â‚¹{item.price.toLocaleString('en-IN', { style: 'currency', currency: 'INR' })}
            </div>
            <button
              onClick={() => handleAddToCart(item)}
              className="btn-add-cart"
              style={{
                backgroundColor: '#d32f2f',
                color: 'white',
                border: 'none',
                padding: '0.4rem 0.8rem',
                borderRadius: '4px',
                cursor: 'pointer',
                fontWeight: '600',
                transition: 'background-color 0.3s ease',
              }}
            >
              Add to Cart
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PopularFood;
